import React, { Component } from 'react';
import {
  Header,
  Image
}
  from 'semantic-ui-react';
import ringImage from '../../public/images/ring-image.jpg';
import Swiper from '../Swiper';
import './index.css';


class Body extends Component {
  renderNotLogged = () => {
    return (
      <Header as='h1' textAlign='center'>
        Hi
      </Header>
    );
  }
  renderLogged = () => {
    return (
      <Header as='h1' textAlign='center'>
        Heyyyyy
      </Header>
    );
  }
  render() {

    const isLogged = this.props.isLogged;

    return (
      <div>
        {isLogged ?
          <div>
            {this.renderLogged()}
          </div>
          :
          <div>
            {this.renderNotLogged()}
          </div>
        }
        <Swiper
          swiperOptions={{ speed: 500, autoplay: { disableOnInteraction: false } }}
          loop={true}
          pagination={true}
          navigation={false}
          style={{border:"1px"}}
        >
          <Slide key={0} onActive={swiper => console.log('Slide Active!')}>
            <div>
              <Image src={ringImage} className="swiper-image" />}
            </div>
          </Slide>
          <Slide key={1}  onActive={swiper => console.log('Slide Active!')}>
            <div>
              <Image src={ringImage} className="swiper-image" />}
            </div>
          </Slide>
          <Slide  key={2}  onActive={swiper => console.log('Slide Active!')}>
            <div>
              <Image src={ringImage} className="swiper-image" />}
            </div>
          </Slide>
        </Swiper>
      </div>

    )
  }
}
export default Body;
